import React from 'react';
import SingleTextInput from './SingleTextInput';

const CreateEmployeeForm = () => {
  let basicData = [
    { title: 'First Name' },
    { title: 'Last Name' },
    { title: 'Date of Birth' },
    { title: 'Start Date' },
  ];
  return (
    <form action='#' id='create-employee'>
      {basicData.map((elt) => (
        <SingleTextInput {...elt}></SingleTextInput>
      ))}
    </form>
  );
};

export default CreateEmployeeForm;
